import React from 'react'
import './index.less'
import {Card, Button, message, Icon} from 'antd'
export default class Record extends React.Component {

    handleClick=()=> {
        message.success("HAHAHAH");
    }

    render(){
        return (
            <div class="container">
                <Card 
                    title = "Medical Record" 
                    className="cardWrap" 
                    bordered={false}
                    extra={
                        <Button type="primary" shape="round" size={"large"}><Icon type="plus"/>  New Record</Button>
                    }
                >
                </Card>
            </div>
        );
    }
}
class FilterForm extends React.Component{

    render(){
        return (
            <div>
                <span>Medical Record</span>
                <Button><Icon type="filter" /></Button>
                <Button><Icon type="reload" /></Button>
                <Button><Icon type="more" /></Button>
            </div>
        );
    }
}
FilterForm = Form.create({})(FilterForm);
